func TestTransaction_IsSuccess(t *testing.T) {
	cases := []struct {
		success bool
		data    string
	}{
		{true, ""},
		{false, ""},
		{true, ""},
		{true, ""},
		{true, ""},
		{false, ""},
		{false, ""},
		{false, ""},
		{false, ""},
	}
	for i, c := range cases {
		cells, err := boc.DeserializeBocHex(c.data)
		if err != nil {
			t.Fatalf("%v %v", i, err)
		}
		var tx Transaction
		err = Unmarshal(cells[0], &tx)
		if err != nil {
			t.Fatal(err)
		}
		if tx.IsSuccess() != c.success {
			t.Fatal(i)
		}
	}
}
